import React from 'react';
import Navi from './Navi';
import CategoryList from './CategoryList';
import ProductLists from './ProductList';
import { Container, Row } from 'reactstrap'

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Navi />
        </Row>
        <Row>
          <CategoryList />
          <ProductLists />
        </Row>
      </Container>
    </div>
  );
}

export default App;
